import React from 'react';

const About = () => {
  return (
    <section className='section about-section'>
      <h1>About Us</h1>
      <p>
        Welcome to my cocktails page. 2020 has been one interesting year, so take 
        sometime to scroll through and find a drink that suits your fancy. Follow the recipes 
        and put your own spin on it if you want. Cheers! 
      </p>
    </section>
  )
} 

export default About;
